  false,\n\t\"url\": null,\n\t\"notes\": \"This document includes the Environmental
  Assessment (EA), Finding of No Significant Impact (FONSI), Section 7 Evaluation,
  and Compatibility Determination for the construction, restoration, and rehabilitative
  project at Big Lake NWR. The purpose of the proposed action is to restore historic
  waterflow and water management capability to Big Lake NWR, conduct a 90 day drawdown
  to compact the buildup of sediments and organic matter on the lake substrate, improve
  the sport fishery, construct a 200 acre moist soils management unit, and install
  a drift barrier\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
